emaakt.\";s:30:\"Put site into maintenance mode\";s:36:\"De website in onderhoudsmodus zetten\";s:269:\"Visitors will only see the maintenance mode message. Only users with the \"Access site in maintenance mode\" <a href=\"@permissions-url\">permission</a> will be able to access the site. Authorized users can log in directly via the <a href=\"@user-login\">user login</a> page.\";b:1;s:43:\"Message to display when in maintenance mode\";s:82:\"Boodschap die aan de bezoekers wordt getoond als de site in onderhoudsmodus staat.\";s:18:\"Save configuration\";s:20:\"Instellingen opslaan\";s:8:\"Settings\";s:12:\"Instellingen\";s:42:\"The configuration options have been saved.\";s:32:\"De instellingen zijn opgeslagen.\";s:3:\"new\";s:5:\"nieuw\";s:9:\"published\";s:12:\"gepubliceerd\";s:26:\"<em>Edit @type</em> @title\";s:39:\"<em>@type</em> @title <em>bewerken</em>\";s:23:\"Save and keep published\";s:27:\"Bewaar en houd gepubliceerd\";s:18:\"Save and unpublish\";s:23:\"Opslaan en depubliceren\";s:133:\"One or more problems were detected with your Drupal installation. Check the <a href=\"@status\">status report</a> for more information.\";s:145:\"EÃ©n of meerdere problemen zijn gedetecteerd in de Drupal-installatie. Controleer de <a href=\"@status\">statusrapportage</a> voor meer informatie.\";s:17:\"Hide descriptions\";s:24:\"Beschrijvingen verbergen\";s:39:\"Compress layout by hiding descriptions.\";s:52:\"Lay-out verkleinen door beschrijvingen te verbergen.\";s:12:\"Site details\";s:15:\"Websitegegevens\";s:9:\"Site name\";s:19:\"Naam van de website\";s:6:\"Slogan\";s:6:\"Slogan\";s:46:\"How this is used depends on your site\'s theme.\";s:59:\"Hoe deze gebruikt wordt hangt van het thema van de site af.\";s:13:\"Email address\";s:11:\"E-mailadres\";s:218:\"The <em>From</em> address in automated emails sent during registration and new password requests, and other notifications. (Use an address ending in your site\'s domain to help prevent this email being flagged as spam.)\";b:1;s:18:\"Default front page\";s:19:\"Standaardvoorpagina\";s:111:\"Optionally, specify a relative URL to display as the front page. Leave blank to display the default front page.\";b:1;s:11:\"Error pages\";s:20:\"Foutmeldingspagina\'s\";s:32:\"Default 403 (access denied) page\";s:39:\"Standaard 403-pagina (verboden toegang)\";s:136:\"This page is displayed when the requested document is denied to the current user. Leave blank to display a generic \"access denied\" page.\";s:167:\"Deze pagina wordt getoond wanneer het opgevraagde document niet toegankelijk is voor de huidige gebruiker. Laat dit leeg om de algemene pagina \'geen toegang\' te tonen.\";s:28:\"Default 404 (not found) page\";s:36:\"Standaard 404-pagina (niet gevonden)\";s:132:\"This page is displayed when no other content matches the requested document. Leave blank to display a generic \"page not found\" page.\";s:160:\"Deze pagina wordt getoond wanneer geen andere inhoud overeenkomt met de opgevraagde pagina. Laat dit leeg om de algemene pagina \'pagina niet gevonden\' te tonen.\";s:19:\"1 hour@count hours\";s:16:\"1 uur@count uur\";s:6:\"Blocks\";s:7:\"Blokken\";s:5:\"Types\";s:7:\"Soorten\";s:16:\"Add custom block\";s:24:\"Aangepast blok toevoegen\";s:17:\"Powered by Drupal\";s:18:\"Gebouwd met Drupal\";s:13:\"Site branding\";b:1;s:11:\"Breadcrumbs\";s:10:\"Kruimelpad\";s:8:\"Messages\";s:9:\"Berichten\";s:17:\"Main page content\";s:29:\"Primaire inhoud van de pagina\";s:9:\"Syndicate\";s:10:\"Syndicatie\";s:11:\"Place block\";s:14:\"Blok plaatsten\";s:6:\"Filter\";s:6:\"Filter\";s:20:\"Filter by block name\";s:18:\"Filter op bloknaam\";s:44:\"Enter a part of the block name to filter by.\";s:35:\"Filter op een deel van de bloknaam.\";s:20:\"No blocks available.\";b:1;s:10:\"User login\";s:15:\"Gebruikerslogin\";s:15:\"Anonymous users\";s:19:\"Anonieme gebruikers\";s:42:\"The name used to indicate anonymous users.\";s:84:\"De naam die gebruikt wordt om een anonieme (niet ingelogde) gebruiker aan te duiden.\";s:18:\"Administrator role\";s:13:\"Beheerdersrol\";s:146:\"This role will be automatically assigned new permissions whenever a module is enabled. Changing this setting will not affect existing permissions.\";s:170:\"Aan deze rol zullen automatisch rechten toegekend worden wanneer een module ingeschakeld wordt. Het veranderen van deze instelling heeft geen effect op bestaande rechten.\";s:29:\"Registration and cancellation\";s:25:\"Registratie en annulering\";s:26:\"Who can register accounts?\";s:26:\"Wie mag accounts aanmaken?\";s:19:\"Administrators only\";s:21:\"Enkel voor beheerders\";s:8:\"Visitors\";s:9:\"Bezoekers\";s:48:\"Visitors, but administrator approval is required\";s:55:\"Bezoekers, maar goedkeuring door beheerder is verplicht\";s:60:\"Require email verification when a visitor creates an account\";s:81:\"E-mailverificatie verplichten bij het aanmaken van een account door een bezoeker.\";s:278:\"New users will be required to validate their email address prior to logging into the site, and will be assigned a system-generated password. With this setting disabled, users will be logged in immediately upon registering, and may select their own passwords during registration.\";b:1;s:34:\"Enable password strength indicator\";b:1;s:30:\"When cancelling a user account\";s:43:\"Bij het annuleren van een gebruikersaccount\";s:36:\"Select method for cancelling account\";s:47:\"Selecteer de annuleringsmethode voor de account\";s:16:\"Administer users\";s:18:\"Gebruikers beheren\";s:134:\"Users with the %select-cancel-method or %administer-users <a href=\"@permissions-url\">permissions</a> can override this default method.\";s:151:\"Gebruikers met de <a href=\"@permissions-url\">toegangsrechten</a> %select-cancel-method of  %administer-users kunnen deze standaardmethode te niet doen.\";s:41:\"Disable the account and keep its content.\";b:1;s:131:\"Your account will be blocked and you will no longer be able to log in. All of your content will remain attributed to your username.\";b:1;s:46:\"Disable the account and unpublish its content.\";s:50:\"Het account uitschakelen en de inhoud verwijderen.\";s:139:\"Your account will be blocked and you will no longer be able to log in. All of your content will be hidden from everyone but administrators.\";s:170:\"Uw account zal geblokkeerd worden en u zult niet meer kunnen inloggen. Al uw inhoud zal niet langer gepubliceerd worden en alleen nog maar zichtbaar zijn voor beheerders.\";s:75:\"Delete the account and make its content belong to the %anonymous-name user.\";s:72:\"Het account verwijderen en de inhoud eigendom maken van %anonymous-name.\";s:131:\"Your account will be removed and all account information deleted. All of your content will be assigned to the %anonymous-name user.\";s:139:\"Uw account en alle bijbehorende informatie zal verwijderd worden. Al uw inhoud zal aan de gebruiker %anonymous-name user worden toegewezen.\";s:35:\"Delete the account and its content.\";s:37:\"Het account en de inhoud verwijderen.\";s:107:\"Your account will be removed and all account information deleted. All of your content will also be deleted.\";s:105:\"Uw account en alle bijbehorende informatie zal verwijderd worden. Ook al uw inhoud zal worden verwijderd.\";s:26:\"Notification email address\";s:24:\"E-mailadres kennisgeving\";s:334:\"The email address to be used as the \'from\' address for all account notifications listed below. If <em>\'Visitors, but administrator approval is required\'</em> is selected above, a notification email will also be sent to this address for any new registrations. Leave empty to use the default system email address <em>(%site-email).</em>\";b:1;s:6:\"Emails\";s:7:\"E-mails\";s:174:\"Available variables are: [site:name], [site:url], [user:name], [user:mail], [site:login-url], [site:url-brief], [user:edit-url], [user:one-time-login-url], [user:cancel-url].\";s:173:\"Beschikbare variabelen: [site:name], [site:url], [user:name], [user:mail], [site:login-url], [site:url-brief], [user:edit-url], [user:one-time-login-url], [user:cancel-url].\";s:43:\"Welcome (new user created by administrator)\";s:51:\"Welkom (nieuwe gebruiker aangemaakt door beheerder)\";s:88:\"Edit the welcome email messages sent to new member accounts created by an administrator.\";s:98:\"De welkomstboodschap bewerken die wordt verstuurd als een beheerder een nieuwe gebruiker aanmaakt.\";s:7:\"Subject\";s:9:\"Onderwerp\";s:4:\"Body\";s:6:\"Inhoud\";s:27:\"Welcome (awaiting approval)\";s:38:\"Welkom (in afwachting van goedkeuring)\";s:111:\"Edit the welcome email messages sent to new members upon registering, when administrative approval is required.\";s:118:\"De welkomstboodschap bewerken die wordt verstuurd na registratie waarbij een goedkeuring door de beheerder is vereist.\";s:30:\"Admin (user awaiting approval)\";s:42:\"Beheerder (gebruiker wacht op goedkeuring)\";s:108:\"Edit the email notifying the site administrator that there are new members awaiting administrative approval.\";b:1;s:30:\"Welcome (no approval required)\";s:33:\"Welkom (geen goedkeuring vereist)\";s:113:\"Edit the welcome email messages sent to new members upon registering, when no administrator approval is required.\";s:119:\"De welkomstboodschap bewerken die wordt verstuurd na registratie waarbij geen goedkeuring door de beheerder is vereist.\";s:17:\"Password recovery\";s:27:\"Wachtwoord opnieuw opvragen\";s:65:\"Edit the email messages sent to users who request a new password.\";s:98:\"De e-mailberichten bewerken die de gebruikers ontvangen wanneer ze een nieuw wachtwoord aanvragen.\";s:18:\"Account activation\";s:16:\"Accountactivatie\";s:204:\"Enable and edit email messages sent to users upon account activation (when an administrator activates an account of a user who has already registered, on a site where administrative approval is required).\";b:1;s:37:\"Notify user when account is activated\";s:56:\"Informeer de gebruiker zodra het account is geactiveerd.\";s:15:\"Account blocked\";s:19:\"Account geblokkeerd\";s:77:\"Enable and edit email messages sent to users when their accounts are blocked.\";s:127:\"Schakel e-mailberichten in die verstuurd worden naar gebruikers wanneer hun account wordt geblokkeerd en bewerk deze berichten.\";s:35:\"Notify user when account is blocked\";s:55:\"Informeer de gebruiker zodra het account is geblokkeerd\";s:33:\"Account cancellation confirmation\";s:35:\"Bevestiging om account te annuleren\";s:81:\"Edit the email messages sent to users when they attempt to cancel their accounts.\";s:89:\"De e-mailberichten bewerken die de gebruikers ontvangen wanneer ze hun account annuleren.\";s:16:\"Account canceled\";s:19:\"Account geannuleerd\";s:78:\"Enable and edit email messages sent to users when their accounts are canceled.\";s:127:\"Schakel e-mailberichten in die verstuurd worden naar gebruikers wanneer hun account wordt geannuleerd en bewerk deze berichten.\";s:36:\"Notify user when account is canceled\";s:57:\"Informeer gebruiker wanneer het account wordt geannuleerd\";s:51:\"%name: The integer must be larger or equal to %min.\";s:53:\"%name: Het getal moet groter of gelijk aan %min zijn.\";s:30:\"@type %title has been updated.\";s:27:\"@type %title is bijgewerkt.\";s:14:\"Filter modules\";s:16:\"Modules filteren\";s:29:\"Filter by name or description\";b:1;s:46:\"Enter a part of the module name or description\";b:1;s:61:\"Perform tasks on specific events triggered within the system.\";b:1;s:7:\"Install\";s:11:\"Installeren\";s:45:\"Enables tracking of recent content for users.\";s:36:\"Volgt recente inhoud van gebruikers.\";s:7:\"@module\";b:1;s:54:\"@module (<span class=\"admin-disabled\">disabled</span>)\";s:59:\"@module (<span class=\"admin-disabled\">uitgeschakeld</span>)\";s:79:\"Aggregates syndicated content (RSS, RDF, and Atom feeds) from external sources.\";s:76:\"Verzamelt gesyndiceerde inhoud (RSS, RDF en Atom feeds) van externe bronnen.\";s:32:\"Enables banning of IP addresses.\";s:42:\"Sc