jkheid om met trefwoorden de website te doorzoeken.\";s:80:\"Provides a service for (de)serializing data to/from formats such as JSON and XML\";b:1;s:60:\"Allows users to manage customizable lists of shortcut links.\";s:57:\"Staat gebruikers toe om snelkoppelingslijsten te beheren.\";s:38:\"Logs content statistics for your site.\";s:38:\"Logt toegangsstatistieken van de site.\";s:41:\"Logs and records system events to syslog.\";b:1;s:54:\"Handles general site configuration for administrators.\";s:60:\"Behandelt algemene instellingen van de site voor beheerders.\";s:38:\"Enables the categorization of content.\";s:63:\"Biedt de mogelijkheid inhoud in categorieÃ«n onder te verdelen.\";s:43:\"Defines a field type for telephone numbers.\";s:45:\"Definieert een veldtype voor telefoonnummers.\";s:53:\"Provides a framework for unit and functional testing.\";s:52:\"Biedt een raamwerk voor unit- en functionele testen.\";s:32:\"Defines simple text field types.\";s:30:\"Levert simpele tekstveldtypes.\";s:99:\"Provides a means to associate text formats with text editor libraries such as WYSIWYGs or toolbars.\";b:1;s:99:\"Provides a toolbar that shows the top-level administration menu items and links from other modules.\";s:91:\"Biedt een werkbalk die de top-level beheermenu-items en links van andere modules weergeeft.\";s:22:\"Provides guided tours.\";b:1;s:104:\"Checks for available updates, and can securely install or update modules and themes via a web interface.\";s:140:\"Controleert op beschikbare updates en maakt het mogelijk om veilig via een web-interface modules en thema\'s te installeren of bij te werken.\";s:47:\"Manages the user registration and login system.\";s:51:\"Beheert het gebruikersregistratie- en loginsysteem.\";s:55:\"Create customized lists and queries from your database.\";s:59:\"Aangepaste lijsten en queries vanuit de database creÃ«eren.\";s:35:\"Administrative interface for Views.\";s:26:\"Beheerinterface voor Views\";s:4:\"Core\";s:4:\"Kern\";s:9:\"Installed\";s:14:\"GeÃ¯nstalleerd\";s:12:\"Multilingual\";s:9:\"Meertalig\";s:11:\"Field types\";s:9:\"Veldtypes\";s:27:\"Machine name: !machine-name\";s:26:\"Machinenaam: !machine-name\";s:24:\"Version: !module-version\";s:23:\"Versie: !module-version\";s:22:\"Requires: !module-list\";s:21:\"Vereist: !module-list\";s:25:\"Required by: !module-list\";s:26:\"Vereist voor: !module-list\";s:9:\"Uninstall\";s:14:\"DeÃ¯nstalleren\";s:8:\"Watchdog\";s:8:\"Watchdog\";s:11:\"Log entries\";s:12:\"Logberichten\";s:31:\"Contains a list of log entries.\";b:1;s:3:\"WID\";b:1;s:25:\"Unique watchdog event ID.\";b:1;s:3:\"UID\";s:3:\"UID\";s:60:\"The user ID of the user on which the log entry was written..\";b:1;s:43:\"The user on which the log entry as written.\";b:1;s:62:\"The of the log entry, for example \"user\" or \"page not found.\".\";b:1;s:7:\"Message\";s:7:\"Bericht\";s:36:\"The actual message of the log entry.\";b:1;s:9:\"Variables\";s:10:\"Variabelen\";s:54:\"The variables of the log entry in a serialized format.\";b:1;s:14:\"Severity level\";s:11:\"Ernstniveau\";s:72:\"The severity level of the event; ranges from 0 (Emergency) to 7 (Debug).\";s:72:\"De zwaarte van de gebeurtenis; varieert van 0 (Noodgeval) tot 7 (Debug).\";s:30:\"Operation links for the event.\";b:1;s:8:\"Location\";s:7:\"Locatie\";s:31:\"URL of the origin of the event.\";s:35:\"URL van de bron van de gebeurtenis.\";s:7:\"Referer\";b:1;s:25:\"URL of the previous page.\";s:25:\"URL van de vorige pagina.\";s:8:\"Hostname\";s:8:\"Hostnaam\";s:45:\"Hostname of the user who triggered the event.\";s:62:\"Hostnaam van de gebruiker die de gebeurtenis heeft getriggerd.\";s:9:\"Timestamp\";s:8:\"Tijdstip\";s:29:\"Date when the event occurred.\";s:49:\"Datum waarop de gebeurtenis heeft plaatsgevonden.\";s:6:\"Global\";s:8:\"Algemeen\";s:6:\"Random\";s:11:\"Willekeurig\";s:28:\"Randomize the display order.\";s:43:\"De weergave-volgorde op willekeurig zetten.\";s:4:\"Null\";s:4:\"Null\";s:213:\"Allow a contextual filter value to be ignored. The query will not be altered by this contextual filter value. Can be used when contextual filter values come from the URL, and a part of the URL needs to be ignored.\";s:242:\"Een contextuele filterwaarde kan worden genegeerd. De query zal niet veranderd worden door deze contextuele filterwaarde. Kan gebruikt worden wanneer de contextuele filterwaarde van de URL afkomt, en een deel van de URL genegeerd moet worden.\";s:11:\"Custom text\";s:16:\"Aangepaste tekst\";s:28:\"Provide custom text or link.\";s:38:\"Aangepaste tekst of een link invullen.\";s:19:\"View result counter\";s:26:\"Resultatenteller weergeven\";s:47:\"Displays the actual position of the view result\";s:58:\"Geeft de actuele positie van het overzichtsresultaat weer.\";s:9:\"Text area\";s:9:\"Tekstveld\";s:33:\"Provide markup text for the area.\";s:31:\"Tekst voor het gebied invoeren.\";s:15:\"Unfiltered text\";s:18:\"Ongefilterde tekst\";s:82:\"Add unrestricted, custom text or markup. This is similar to the custom text field.\";s:105:\"Aangepaste tekst of HTML toevoegen zonder beperkingen. Dit is vergelijkbaar met het aangepaste tekstveld.\";s:14:\"Title override\";s:17:\"Vervangende titel\";s:115:\"Override the default view title for this view. This is useful to display an alternative title when a view is empty.\";b:1;s:9:\"View area\";s:24:\"Gebied van het overzicht\";s:29:\"Insert a view inside an area.\";s:37:\"Een overzicht in een gebied plaatsen.\";s:14:\"Result summary\";s:30:\"Samenvatting van het resultaat\";s:53:\"Shows result summary, for example the items per page.\";s:83:\"Een samenvatting van de resultaten tonen. Bijvoorbeeld het aantal items per pagina.\";s:29:\"Displays messages in an area.\";s:30:\"Toont berichten in een gebied.\";s:20:\"Response status code\";b:1;s:88:\"Alter the HTTP response status code used by this view, mostly helpful for empty results.\";b:1;s:21:\"Combine fields filter\";s:23:\"Veldenfilter combineren\";s:47:\"Combine two fields togeth