,'Fid','','8.0.0-beta14'),(7200,'Mime type','','8.0.0-beta14'),(7201,'Upload date','','8.0.0-beta14'),(7202,'Changed date','','8.0.0-beta14'),(7203,'1 place@count places','','8.0.0-beta14'),(7204,'No files available.','','8.0.0-beta14'),(7205,'Files overview','','8.0.0-beta14'),(7206,'Registering module','','8.0.0-beta14'),(7207,'1@count','','8.0.0-beta14'),(7208,'File usage information for %1','','8.0.0-beta14'),(7209,'<p>This page provides the ability to add common languages to your site.</p><p>If the desired language is not available, you can add a custom language.</p>','','8.0.0-beta14'),(7210,'Select language','','8.0.0-beta14'),(7211,'<p>Choose a language from the list, or choose \"Custom language...\" at the end of the list.</p><p>Click the \"Add language\" button when you are done choosing your language.</p><p>When adding a custom language, you will get an additional form where you can provide the name, code, and direction of the language.</p>','','8.0.0-beta14'),(7212,'Continuing on','','8.0.0-beta14'),(7213,'<p>Now that you have an overview of the \"Add languages\" feature, you can continue by:<ul><li>Adding a language</li><li>Adding a custom language</li><li><a href=\"[site:url]/admin/config/regional/language\">Viewing configured languages</a></li></ul></p>','','8.0.0-beta14'),(7214,'Editing languages','','8.0.0-beta14'),(7215,'<p>This page provides the ability to edit a language on your site, including custom languages.</p>','','8.0.0-beta14'),(7216,'<p>You cannot change the code of a language on the site, since it is used by the system to keep track of the language.</p>','','8.0.0-beta14'),(7217,'<p>The language name is used throughout the site for all users and is written in English. Names of built-in languages can be translated using the Interface Translation module, and names of both built-in and custom languages can be translated using the Configuration Translation module.</p>','','8.0.0-beta14'),(7218,'Language direction','','8.0.0-beta14'),(7219,'<p>Choose if the language is a \"Left to right\" or \"Right to left\" language.</p><p>Note that not all themes support \"Right to left\" layouts, so test your theme if you are using \"Right to left\".</p>','','8.0.0-beta14'),(7220,'<p>Now that you have an overview of the \"Edit language\" feature, you can continue by:<ul><li>Editing a language</li><li><a href=\"[site:url]/admin/config/regional/language\">Viewing configured languages</a></li></ul></p>','','8.0.0-beta14'),(7221,'<p>The \"Languages\" page allows you to add, edit, delete, and reorder languages for the site.</p>','','8.0.0-beta14'),(7222,'<p>To add more languages to your site, click the \"Add language\" button.</p><p>Added languages will be displayed in the language list and can then be edited or deleted.</p>','','8.0.0-beta14'),(7223,'Reordering languages','','8.0.0-beta14'),(7224,'<p>To reorder the languages on your site, use the drag icons next to each language.</p><p>The order shown here is the display order for language lists on the site such as in the language switcher blocks provided by the Interface Translation and Content Translation modules.</p><p>When you are done with reordering the languages, click the \"Save configuration\" button for the changes to take effect.</p>','','8.0.0-beta14'),(7225,'Set a language as default','','8.0.0-beta14'),(7226,'<p>You can change the default language of the site by choosing one of your configured languages as default. The site will use the default language in situations where no choice is made but a language should be set, for example as the language of the displayed interface.</p>','','8.0.0-beta14'),(7227,'Modifying languages','','8.0.0-beta14'),(7228,'<p>Operations are provided for editing and deleting your languages.</p><p>You can edit the name and the direction of the language.</p><p>Deleted languages can be added back at a later time. Deleting a language will remove all interface translations associated with it, and content in this language will be set to be language neutral. Note that you cannot delete the default language of the site.</p>','','8.0.0-beta14'),(7229,'<p>Now that you have an overview of the \"Languages\" page, you can continue by:<ul><li><a href=\"[site:url]/admin/config/regional/language/add\">Adding a language</a></li><li>Reordering languages</li><li>Editing a language</li><li>Deleting a language</li></ul></p>','','8.0.0-beta14'),(7230,'This page allows you to translate the user interface or modify existing translations. If you have installed your site initially in English, you must first add another language on the <a href=\"[site:url]/admin/config/regional/language\">Languages page</a>, in order to use this page.','','8.0.0-beta14'),(7231,'Choose the language you want to translate.','','8.0.0-beta14'),(7232,'Enter the specific word or sentence you want to translate, you can also write just a part of a word.','','8.0.0-beta14'),(7233,'Filter the search','','8.0.0-beta14'),(7234,'You can search for untranslated strings if you want to translate something that isn\'t translated yet. If you want to modify an existing translation, you might want to search only for translated strings.','','8.0.0-beta14'),(7235,'Apply your search criteria','','8.0.0-beta14'),(7236,'To apply your search criteria, click on the <em>Filter</em> button.','','8.0.0-beta14'),(7237,'You can write your own translation in the text fields of the right column. Try to figure out in which context the text will be used in order to translate it in the appropriate way.','','8.0.0-beta14'),(7238,'Validate the translation','','8.0.0-beta14'),(7239,'When you have finished your translations, click on the <em>Save translations</em> button. You must save your translations, each time before changing the page or making a new search.','','8.0.0-beta14'),(7240,'The translations you have made here will be used on your site\'s user interface. If you want to use them on another site or modify them on an external translation editor, you can <a href=\"[site:url]/admin/config/regional/translate/export\">export them</a> to a .po file and <a href=\"[site:url]/admin/config/regional/translate/import\">import them</a> later.','','8.0.0-beta14'),(7241,'Archive','','8.0.0-beta14'),(7242,'All content, by month.','','8.0.0-beta14'),(7243,'Monthly archive','','8.0.0-beta14'),(7244,'â€¹â€¹','','8.0.0-beta14'),(7245,'â€ºâ€º','','8.0.0-beta14'),(7246,'%1','','8.0.0-beta14'),(7247,'Content Type','','8.0.0-beta14'),(7248,'Unpublished','','8.0.0-beta14'),(7249,'Find and manage content','','8.0.0-beta14'),(7250,'Recent content.','','8.0.0-beta14'),(7251,'Frontpage','','8.0.0-beta14'),(7252,'All content promoted to the front page.','','8.0.0-beta14'),(7253,'No front page content has been created yet.','','8.0.0-beta14'),(7254,'Welcome to [site:name]','','8.0.0-beta14'),(7255,'Glossary','','8.0.0-beta14'),(7256,'All content, by letter.','','8.0.0-beta14'),(7257,'Find and manage people interacting with your site.','','8.0.0-beta14'),(7258,'Name or email contains','','8.0.0-beta14'),(7259,'Who\'s new','','8.0.0-beta14'),(7260,'Shows a list of the newest user accounts on the site.','','8.0.0-beta14'),(7261,'A list of new users','','8.0.0-beta14'),(7262,'Who\'s online block','','8.0.0-beta14'),(7263,'Shows the user names of the most recently active users, and the total number of active users.','','8.0.0-beta14'),(7264,'A user is considered online for this long after they have last viewed a page.','','8.0.0-beta14'),(7265,'Who\'s online','','8.0.0-beta14'),(7266,'There are currently @total users online.','','8.0.0-beta14'),(7267,'There are currently 0 users online.','','8.0.0-beta14'),(7268,'A list of users that are currently logged in.','','8.0.0-beta14'),(7269,'Module %name has been enabled.@count modules have been enabled: %names.','','8.0.0-beta14'),(7270,'The path \'%path\' has to start with a slash.','','8.0.0-beta14'),(7271,'1 error has been found: !errors@count errors have been found: !errors','','8.0.0-beta14'),(7272,'The